import { ADD_FAV, REMOVE_FAV } from "./actions-type";

const add_fav = (character) => {
    return {
        type: ADD_FAV,
        payload: character
    }
}

const remove_fav = (id) => {
    return {
        type: REMOVE_FAV,
        payload: id
    }
}

export { add_fav, remove_fav }
